export default function Element({rank, icon, name, symbol, priceUsd, percent24, type}){

    const dot = priceUsd.indexOf(".")
    let newString = ''
    for(let i = 0; i < dot+4; i++){
        newString += priceUsd[i]
    }

    return(
        <tr className="each">
            <td className="rank">{rank}</td>
            <td>{icon}</td>
            <td>
                <span>{symbol} </span>
                <span>{name}</span>
            </td>
            <td>U${newString}</td>
            <td>{percent24}%</td>
        </tr>
    )
}
